import image from "./surf.JPG";
import images from "./jaws.jpeg"

const Gallery = () => {


    return (
        <div className="gallery">
            <img src={image} alt="Honolua Bay" />
            <h2 className="title">Honolua Bay</h2>
            <img src={image} alt="Jaws" />
            <h2 className="title">Jaws</h2>
        </div>
    );
}

export default Gallery;
